import './Hdr.css';

const Hdr = ({ onAddUserClick }) => {
  return (
    <div className="hdr">
      <h1>Warner Reviews</h1>
      <button onClick={onAddUserClick} className="add-user-button">
        Write a review!
      </button>
    </div>
  );
};

export default Hdr;
